  cx: "6",
  cy: "6",
  r: "3",
  key: "ey9bbu"
}], ["circle", {
  cx: "6",
  cy: "18",
  r: "3",
  key: "l375l1"
}], ["line", {
  x1: "20",
  y1: "4",
  x2: "8.12",
  y2: "15.88",
  key: "19romf"
}], ["line", {
  x1: "14.47",
  y1: "14.48",
  x2: "20",
  y2: "20",
  key: "16feih"
}], ["line", {
  x1: "8.12",
  y1: "8.12",
  x2: "12",
  y2: "12",
  key: "9wbq4w"
}]]]);
export default Scissors;
